import React, {useState, useEffect} from 'react';
import Loading from "./loading";


const Loader = () => {
    const [loading, setIsLoading] = useState(true);

    useEffect(() => {
        setTimeout(() => {
            setIsLoading(false);
        }, 2000);
    }, []);

    if(loading) {
        return <Loading />;
    }

}

export default Loader;
